window.bookSummaryJSON = "<p>They showed up when I had no one else, their motives totally obscure. Driven by my need for closure, I find myself inexplicably drawn to them.</p> <p>At the lowest point in my life, they offered me a twisted redemption: revenge.</p> <p>Having them around ignites conflicting emotions within me—familiarity intertwined with so much doubt—<i>and they want nothing more than to keep me.</i></p> <p>They have the means to my end. But can I trust them? And can I allow myself to stay when their sins remain unspoken, threatening to tear everything apart again?</p> <p>Contains mature themes.</p>"; 
